import Dashboard from '../components/dashboard/Dashboard';
import Stats from '../components/dashboard/Stats';

const DashboardPage = () => {
    return (
        <div>
            <h1>Dashboard</h1>
            <Dashboard />
            <Stats />
        </div>
    );
};

export default DashboardPage;
